import React, { useState } from 'react';
import { Check, Star, Zap, Crown, Shield, Rocket } from 'lucide-react';
import './PremiumSection.css';

const PremiumSection = () => {
  const [billingCycle, setBillingCycle] = useState('monthly');

  const plans = [
    {
      name: 'Starter',
      icon: <Zap className="plan-icon" />,
      description: 'Perfect for new freelancers',
      monthlyPrice: 29,
      yearlyPrice: 290,
      features: [
        'Up to 5 active projects',
        'Basic project templates',
        'Email support',
        'Client communication tools',
        'Basic invoicing',
        'Time tracking'
      ],
      popular: false,
      colorClass: 'starter'
    },
    {
      name: 'Professional',
      icon: <Crown className="plan-icon" />,
      description: 'Most popular for growing freelancers',
      monthlyPrice: 59,
      yearlyPrice: 590,
      features: [
        'Unlimited projects',
        'Advanced templates & workflows',
        'Priority support',
        'Advanced client portal',
        'Automated invoicing & payments',
        'Advanced time tracking & reports',
        'Contract management',
        'Team collaboration (up to 3 members)'
      ],
      popular: true,
      colorClass: 'professional'
    },
    {
      name: 'Enterprise',
      icon: <Rocket className="plan-icon" />,
      description: 'For established agencies',
      monthlyPrice: 99,
      yearlyPrice: 990,
      features: [
        'Everything in Professional',
        'Unlimited team members',
        'White-label solutions',
        'API access',
        'Custom integrations',
        'Dedicated account manager',
        'Advanced analytics & insights',
        'Custom contracts & proposals'
      ],
      popular: false,
      colorClass: 'enterprise'
    }
  ];

  const getPrice = (plan) =>
    billingCycle === 'monthly' ? plan.monthlyPrice : plan.yearlyPrice;

  const getSavings = (plan) => {
    const yearlyTotal = plan.monthlyPrice * 12;
    const savings = yearlyTotal - plan.yearlyPrice;
    return Math.round((savings / yearlyTotal) * 100);
  };

  return (
    <section className="premium-section">
      <div className="container">
        {/* Header */}
        <div className="section-header">
          <div className="premium-badge">
            <Star className="badge-icon" />
            <span>Premium Plans</span>
          </div>
          <h2 className="section-title">
            Take Your Freelance{' '}
            <span className="title-highlight">
              Business to the Next Level
            </span>
          </h2>
          <p className="section-description">
            Unlock powerful tools, advanced features, and premium support to grow your freelance business faster than ever before.
          </p>
        </div>

        {/* Billing Toggle */}
        <div className="billing-toggle-wrapper">
          <div className="billing-toggle">
            <button
              onClick={() => setBillingCycle('monthly')}
              className={`toggle-btn ${billingCycle === 'monthly' ? 'active' : ''}`}
            >
              Monthly
            </button>
            <button
              onClick={() => setBillingCycle('yearly')}
              className={`toggle-btn ${billingCycle === 'yearly' ? 'active' : ''}`}
            >
              Yearly
              <span className="savings-badge">Save 20%</span>
            </button>
          </div>
        </div>

        {/* Pricing Cards */}
        <div className="pricing-grid">
          {plans.map((plan) => (
            <div
              key={plan.name}
              className={`pricing-card ${plan.colorClass} ${plan.popular ? 'popular' : ''}`}
            >
              {plan.popular && (
                <div className="popular-badge">Most Popular</div>
              )}
              <div className="card-content">
                {/* Plan header */}
                <div className="plan-header">
                  <div className={`icon-wrapper ${plan.colorClass}`}>
                    {plan.icon}
                  </div>
                  <div className="plan-info">
                    <h3 className="plan-name">{plan.name}</h3>
                    <p className="plan-description">{plan.description}</p>
                  </div>
                </div>

                {/* Pricing */}
                <div className="pricing-info">
                  <div className="price-wrapper">
                    <span className="price">${getPrice(plan)}</span>
                    <span className="period">
                      /{billingCycle === 'monthly' ? 'month' : 'year'}
                    </span>
                  </div>
                  {billingCycle === 'yearly' && (
                    <p className="savings-text">
                      Save {getSavings(plan)}% with yearly billing
                    </p>
                  )}
                </div>

                {/* Features */}
                <ul className="features-list">
                  {plan.features.map((feature, index) => (
                    <li key={index} className="feature-item">
                      <Check className="check-icon" />
                      <span>{feature}</span>
                    </li>
                  ))}
                </ul>

                {/* CTA */}
                <button className={`cta-button ${plan.colorClass} ${plan.popular ? 'popular' : ''}`}>
                  {plan.popular ? 'Start Free Trial' : 'Get Started'}
                </button>
              </div>
            </div>
          ))}
        </div>

        {/* Trust Section */}
        <div className="trust-section">
          <div className="trust-indicators">
            <div className="trust-item">
              <Shield className="trust-icon" />
              <span>30-day money back guarantee</span>
            </div>
            <div className="trust-item">
              <Star className="trust-icon star" />
              <span>4.9/5 from 10,000+ freelancers</span>
            </div>
          </div>
          <p className="trust-text">
            Join thousands of successful freelancers who've transformed their business with our platform
          </p>
        </div>
      </div>
    </section>
  );
};

export default PremiumSection;
